public class problem8
{
  public static void main(String[]args)
  {
    String x = "";
  long max_produc=1;
  long tmp = 0;

    for(int i = 0 ;i+4 < x.length()-1;i++)
    {
      tmp =  Character.getNumericValue(x.charAt(i))  *Character.getNumericValue(x.charAt(i+1))*  Character.getNumericValue(x.charAt(i+2))  *Character.getNumericValue(x.charAt(i+3))  *Character.getNumericValue(x.charAt(i+4))  ;
      if(tmp >max_produc ){
        System.out.println(Character.getNumericValue(x.charAt(i)));
        System.out.println(Character.getNumericValue(x.charAt(i+1)));
        System.out.println(Character.getNumericValue(x.charAt(i+2)));
        System.out.println(Character.getNumericValue(x.charAt(i+3)));
        System.out.println(Character.getNumericValue(x.charAt(i+4)));
                                        
        max_produc = tmp;
      }
    }
    System.out.println(max_produc);
  }
}

